import React from "react";

function DetailCard(props) {
  return (
    <>
      <div>
        <img className="detail_img" src={props.imgage} alt="" />
      </div>
      <div>
        <div>{props.title}</div>
        <div>
          저자:{props.author}
          출판사:{props.publisher}
          가격:{props.price}
          출판일:{props.pubDate}
          재고:{props.stock}/5 학부:{props.subjects}
          수업명:{props.className}
          교수:{props.professor}
        </div>
      </div>
    </>
  );
}

export default DetailCard;
